import React from 'react';

import {
  Container,
  Header,
  Main,
  Form,
  ProffysList,
} from './styles';

const Proffys: React.FC = () => (
  <Container>
    <Header />
    <Main>
      <Form />
      <ProffysList />
    </Main>
  </Container>
);

export default Proffys;
